import './App.css';
import {BrowserRouter,Switch,Route} from 'react-router-dom';
import Headers from "./layout/Header";

import "../node_modules/bootstrap/dist/css/bootstrap.min.css"

function App() {
  return (
    <div className="App">
            <BrowserRouter>
        <Switch>
          <Route path="/" exact>
               <Headers/>
               <Register/>
               <Footer/>
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
